INSERT INTO `Solutions_AH` VALUES (52,'Answer: d\nExplanation: Bubble sort works by starting from the first element and swapping the elements if required in each iteration even in the average case.',11,12,168,4,6,0,NULL),(53,'f(x) is a polynomial function and is continuous and differentiable for all real numbers. Let us evalute f(x) at x = -2 and x = 2\nf(-2) = -2(-2) 3 + 6(-2) - 2 = 2\nf(2) = -2(2) 3 + 6(2) - 2 = - 6',11,12,169,0,5,0,NULL),(54,'Purple. Your welcome',12,11,170,4,0,0,NULL);
